'https://binarysearch.com/problems/Sum-of-Two-Numbers-Less-Than-Target'

'''
Given a list of integers nums and an integer target, return the sum of the largest pair of numbers in nums whose sum is less than target.
'''

import time
import math
import sys
import gc
from itertools import combinations
from timeit import timeit


class Solution:
    def solve1(self, nums, target):
        #comb_two = np.array(list(combinations(nums, 2)))
        
        c = combinations(nums, 2)
        comb_two = [item for item in c if sum(item)<target]
        
        # measure the memory used
        #print(sys.getsizeof(comb_two))
        
        sums = [sum(item) for item in comb_two if sum(item)<target]
        
        sum_max = max(sums)
        
        return sum_max
    
    def solve2(self, nums, target):
        
        c = combinations(nums, 2)
        sum_max = float('-inf')

        for item in c:
            if sum(item)<target:
                if sum(item)>sum_max:
                    sum_max = sum(item)

        return sum_max
    
    
    # def __init__(self, nums, target):
    #     self.sum_max = float('-inf')
    #     self.nums = sorted(nums)
    #     self.target = target
        
    
    def solve3(self, nums, target):
        '''We sort the list first, then add the first (smallest) and last (greatest) values. 
        If the sum is too large, we can remove the largest value. 
        If it's too small, we remove the smallest one, until only one item is in 'nums'.
        '''
        
        sum_max = float('-inf')
        nums = sorted(nums)
        target = target
        
        while len(nums)>1:
            
            sum = nums[0] + nums[-1]

            if sum >= target:
                del nums[-1]
            else:
                if sum > sum_max:
                    sum_max = sum
                    
                del nums[0]
                    
            self.solve3(nums, target)
        
        return sum_max
    
    
    # THE BEST SOLUTION !!!!!!!!!!!!!
    def solve4(self, nums, target):
        
        sum_max = float('-inf')
        sum_max = -math.inf
        nums = sorted(nums)
        target = target
        
        i = 0
        j = len(nums) - 1

        while j>i:
            sum = nums[i] + nums[j]

            if sum >= target:
                j = j - 1 
            else: 
                # if sum >= sum_max:
                #     sum_max = sum
                sum_max = max(sum, sum_max)
                i = i + 1
        
        return sum_max


